INSERT INTO `eratown_vendor` VALUES (1,'Adayroi','adayroi','adayroi','/adayroi/','Adayroi là website thương mại điện tử của Công ty Cổ phần Dịch vụ Thương Mại Tổng hợp VinCommerce, một thành viên của Tập đoàn Vingroup.Adayroi là mô hình đại siêu thị điện tử - \"tất cả trong một\". Adayroi cung cấp nhiều ngành hàng đa dạng, từ những hàng hoá giá trị lớn như bất động sản, đến các sản phẩm - dịch vụ phục vụ các nhu cầu thiết thực của cuộc sống hàng ngày như thực phẩm, nhu yếu phẩm, thời trang, du lịch, điện tử, đồ gia dụng, … vượt trội cả về chủng loại và số lượng.',-1,'1,-1','1,-1','http://img.marrybaby.com/logo.png','',1,1,0,0,0,0,0,0,'',5,'','Số 7, đường Bằng Lăng, Việt Hưng',1536,0,0,0,18,0,0,0),(2,'Siêu thị điện máy xanh','sieu-thi-dien-may-xanh','sieu-thi-dien-may-xanh','/sieu-thi-dien-may-xanh/','Siêu thị Điện máy XANH khai trương siêu thị đầu tiên tại 561 Xô Viết Nghệ Tĩnh, Phường 26, Quận Bình Thạnh, Tp.HCM tháng 11/2011. Đến nay, hệ thống siêu thị Điện máy XANH đã mở rộng ra với 95 siêu thị toạ lạc tại 52 tỉnh thành lớn cùng hơn 10.000 nhân viên.',-1,'2,-1','2,-1','http://img.marrybaby.com/lo-go-dienmayxanh.png','',1,1,0,0,0,0,0,0,'',5,'','Tổ 4, khối 1, Đông Anh',1646,0,0,0,1,0,0,0),(3,'FPTShop','fptshop','fptshop','/fptshop/','FPT Shop hệ thống bán lẻ khắp ba miền, với 290 cửa hàng trải khắp 63 tỉnh thành luôn luôn mở rộng để phục vụ Khách hàng trên toàn quốc.',-1,'3,-1','3,-1','http://img.marrybaby.com/logo-black.png','',1,1,0,0,0,0,0,0,'',5,'','số 44, Hàng Bông',1519,0,0,0,7,0,0,0),(4,'VoDichGia.com','vodichgia-com','vodichgia-com','/vodichgia-com/','',-1,'4,-1','4,-1','','',1,1,0,0,0,0,0,0,'',8,'','22b, Phúc Xá',1492,0,0,0,153,0,0,0),(5,'TiBi','tibi','tibi','/tibi/','',-1,'5,-1','5,-1','','',1,1,0,0,0,0,0,0,'',5,'','1, Tân Định',2069,0,0,0,0,0,0,0),(6,'TiBi','tibi','tibi','/tibi/','',-1,'6,-1','6,-1','','',1,1,0,0,0,0,0,0,'',9,'','1, Tân Định',2069,0,0,0,0,0,0,0);
